// Slideshow.js
import React from 'react';
import Slider from 'react-slick';

function Slideshow({ images }) {
    // Slider settings
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 3000,
    };

    return (
        <div className="slideshow-wrapper">
            <Slider {...settings}>
                {images.map((image, index) => (
                    <div key={index}>
                        <img src={image.picUrl} alt={image.movieName} className="slideshow-image"/>
                    </div>
                ))}
            </Slider>
        </div>
    );
}

export default Slideshow;
